      canvas.height = image.height;

      image.onload = function() {
        context.font = "80px PRIMETIME";
        context.fillStyle = "#f4a7bb";
        context.textAlign = "center";
        context.drawImage(image, 0, 0);
        var name = prompt("Enter the name")
        context.fillText(name, canvas.width/2, 500);
        let url = canvas.toDataURL("image/jpg");
        this.download_btn = document.getElementById("download");
        this.download_btn.download = name;
        this.download_btn.href = url;
      };
    },
    download_img() {
      this.download_btn.dispatchEvent(event);
      
